export const addStudents = (data) => {
  console.log("data", data);
  const url = `https://rocky-wave-71489.herokuapp.com/student`;
  return fetch(url, {
    method: "POST",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json",
    },
    body: JSON.stringify(data),
  })
    .then((data) => {
      return data.json();
    })
    .catch((error) => {
      return error.json();
      //   throw error;
    });
};
